WHERE TABLE_SCHEMA = DATABASE() AND TABLE_NAME = 'version_db_world' AND COLUMN_NAME = '2021_10_08_04';
IF @COLEXISTS = 0 THEN LEAVE proc; END IF;
START TRANSACTION;
ALTER TABLE version_db_world CHANGE COLUMN 2021_10_08_04 2021_10_08_05 bit;
SELECT sql_rev INTO OK FROM version_db_world WHERE sql_rev = '1630830751530708500'; IF OK <> 'FALSE' THEN LEAVE proc; END IF;
